query:
/*+ NoMergeJoin(t mi_idx) NoNestLoop(mi_idx t ci) */ select count(*)
from title AS t
inner join movie_info_idx AS mi_idx
on t.id = mi_idx.movie_id AND t.production_year < 2012 AND mi_idx.info_type_id = 99
inner join cast_info AS ci
on t.id = ci.movie_id AND ci.person_id > 2592067 AND ci.role_id = 10;
